function capitalizeFirstLetter(string) {
    return string.charAt(0).toUpperCase() + string.slice(1);
}

function convertToText(obj) {
    //create an array that will later be joined into a string.
    var string = [];

    //is object
    //    Both arrays and objects seem to return "object"
    //    when typeof(obj) is applied to them. So instead
    //    I am checking to see if they have the property
    //    join, which normal objects don't have but
    //    arrays do.
    if (obj == undefined) {
      return String(obj);
    } else if (typeof(obj) == "object" && (obj.join == undefined)) {
        for (prop in obj) {
         if (obj.hasOwnProperty(prop))
            string.push(prop + ": " + convertToText(obj[prop]));
        };
    return "{" + string.join(",") + "}";

    //is array
    } else if (typeof(obj) == "object" && !(obj.join == undefined)) {
        for(prop in obj) {
            string.push(convertToText(obj[prop]));
        }
    return "[" + string.join(",") + "]";

    //is function
    } else if (typeof(obj) == "function") {
        string.push(obj.toString())

    //all other values can be done with JSON.stringify
    } else {
        string.push(JSON.stringify(obj))
    }

    return string.join(",");
}

function scopeConverter(scope){
   var scopeDictionary = {
      "Visitor":"visitor",
      "Current Visit":"current_visit"
   };
   return scopeDictionary[scope];
}

function dataTypeConverter(dataType){
   var dataTypeDictionary = {
      "visitor_property": "properties",
      "visitor_property_set": "property_sets",
      "visitor_metric": "metrics",
      "visitor_metric_set": "metric_sets",
      "visitor_flag": "flags",
      "visitor_date": "dates",
      "visitor_badge": "badges",

   }
   return dataTypeDictionary[dataType];
}

function tagManagerNameBuilder(dataType,scope, name){
   var constantPrefix = "userInfo.dmp" ;
   var firstLevel = constantPrefix + capitalizeFirstLetter(dataType);
   var tagManagerName = [firstLevel,scope,name];
   return  tagManagerName.join('.').replace(/\.\.+/g, '.');

}

function asNameBuilder(dataType,scope,id){
   var constantPrefix = "va";
   if(scope === "visitor"){
      scope = "";
   }
   var asName = [constantPrefix,scope,dataType,id];
   return asName.join('.').replace(/\.\.+/g, '.');
}

function tagManagerDataBuilder(asComponent){
   if(asComponent.context && asComponent.context !== "Event"){
      var componentScope = scopeConverter(asComponent.context);
      var componentDataType = dataTypeConverter(asComponent.type);
      if(componentScope && componentDataType){
         var tagManagerName = tagManagerNameBuilder(componentDataType,componentScope,asComponent.name);
         var asName = asNameBuilder(componentDataType,componentScope,asComponent.id);
         return {
            name: tagManagerName,
            description: asComponent.description,
            extractor: '%%function(){ return utag.data["'+asName+'"];}%%',
            trigger: "asDataLoaded",
            type: "string"
         }
      }
   }
   return undefined;
}

var tagManagerDatas = [];
for (var i = 0; i < ASdata.length; i++){
   var tagManagerData = tagManagerDataBuilder(ASdata[i]);
   if(tagManagerData){
      tagManagerDatas.push(tagManagerData);
   }
   
}
var tagManagerSettings = convertToText(tagManagerDatas);
tagManagerSettings.replace(/(\"\%\%|\%\%\"|\\)/g,'');